import React from 'react';
import Layout from '../../components/Layout';
import { Carousel } from 'react-bootstrap';

function Home () {

    return(
        <Layout>
            <Carousel>
                <Carousel.Item>
                    <img
                        src="../../components/images/florest.jpg"
                        alt="Florest image"
                        className="d-block w-100"
                    ></img>
                </Carousel.Item>
            </Carousel>
        </Layout>
    )
}

export default Home;
